- uid: System.Runtime.InteropServices.UCOMITypeLib.FindName(System.String,System.Int32,System.Runtime.InteropServices.UCOMITypeInfo[],System.Int32[],System.Int16@)
  id: FindName(System.String,System.Int32,System.Runtime.InteropServices.UCOMITypeInfo[],System.Int32[],System.Int16@)
  parent: System.Runtime.InteropServices.UCOMITypeLib
  langs:
  - csharp
  name: FindName(String,Int32,UCOMITypeInfo[],Int32[],Int16)
  nameWithType: UCOMITypeLib.FindName(String,Int32,UCOMITypeInfo[],Int32[],Int16)
  fullName: System.Runtime.InteropServices.UCOMITypeLib.FindName(String,Int32,UCOMITypeInfo[],Int32[],Int16)
  type: Method
  assemblies:
  - mscorlib
  namespace: System.Runtime.InteropServices
  summary: "Söker efter förekomster av en beskrivning i ett typbibliotek."
  remarks: "Det måste finnas tillräckligt med utrymme i `rgMemId` för `pcFound` poster.       Mer information om `ITypeLib::FindName`, finns i MSDN Library."
  syntax:
    content: public void FindName (string szNameBuf, int lHashVal, System.Runtime.InteropServices.UCOMITypeInfo[] ppTInfo, int[] rgMemId, ref short pcFound);
    parameters:
    - id: szNameBuf
      type: System.String
      description: "Sök efter namn."
    - id: lHashVal
      type: System.Int32
      description: "Ett hash-värde för att påskynda sökning, beräknad av den <xref uid=&quot;langword_csharp_LHashValOfNameSys&quot; name=&quot;LHashValOfNameSys&quot; href=&quot;&quot;> </xref> funktion. Om `lHashVal` är 0, ett värde är beräknad."
    - id: ppTInfo
      type: System.Runtime.InteropServices.UCOMITypeInfo[]
      description: "På lyckad return en matris med tips och typen beskrivningar som innehåller namnet som angetts i `szNameBuf`."
    - id: rgMemId
      type: System.Int32[]
      description: "En matris med de <xref uid=&quot;langword_csharp_MEMBERID&quot; name=&quot;MEMBERID&quot; href=&quot;&quot;> </xref> har hittade objekt; `rgMemId` [i] är den <xref uid=&quot;langword_csharp_MEMBERID&quot; name=&quot;MEMBERID&quot; href=&quot;&quot;> </xref> som index i den beskrivning som anges av `ppTInfo` [i]. Kan inte vara <xref uid=&quot;langword_csharp_null&quot; name=&quot;null&quot; href=&quot;&quot;> </xref>."
    - id: pcFound
      type: System.Int16
      description: "Vid inmatning, anger du hur många instanser ska sökas. Till exempel `pcFound` = 1 kan anropas för att hitta den första förekomsten. Sökningen avbryts när en instans hittas.       Anger antalet instanser som hittades vid avslut. Om den <xref uid=&quot;langword_csharp_in&quot; name=&quot;in&quot; href=&quot;&quot;> </xref> och <xref uid=&quot;langword_csharp_out&quot; name=&quot;out&quot; href=&quot;&quot;> </xref> värdena för `pcFound` är identiska, det kan finnas flera beskrivningar som innehåller namnet."
  overload: System.Runtime.InteropServices.UCOMITypeLib.FindName*
  exceptions: []
  platform:
  - net462
